import TextField from "@mui/material/TextField";

const SecondaryUserDataComponent = ({email, password, onChange}) => {
    return (
        <div className="primaryUserData">
          <TextField
            required
            id="outlined-required"
            label="First Name"
          />
          <TextField
            required
            id="outlined-required"
            label="Last Name"
          />
        </div>
      );
}

export default SecondaryUserDataComponent;
